import React, {useState} from 'react';
import {useDispatch, useSelector} from "react-redux";
import UserSalaryRow from './UserSalaryRow';
import { Button } from 'react-bootstrap'
import {Redirect} from 'react-router-dom';

const UserSalaryTable = () => {
  const [redirectAdd, setRedirectAdd] = useState(false);
  const salaryuser = useSelector(state => state.salaryuser.salaryuser);
  if(redirectAdd){
    return <Redirect to='/salarysave'/>
  }
    return (
      <div>

      <table class="table table-dark">
<thead>
<tr>
<th scope="col">ID</th>
<th scope="col">Cost</th>
<th scope="col">Total Hours</th>
<th scope="col">Salary</th>
<th scope="col">Month</th>
<th scope="col"><Button variant="success" onClick = {()=> setRedirectAdd(true)}>Add</Button></th>
</tr>
</thead>
<tbody>
    {
      salaryuser.map((salary) => <UserSalaryRow salary = {salary} />)
    }
</tbody>
</table>
  </div>
        
    )
}

export default UserSalaryTable;
